import React from "react";

function Features() {
  return (
    <div>
      <h2>Features</h2>
      <ul>
        <li>Multi-organ disease prediction</li>
        <li>AI explainability using RAG</li>
        <li>Interactive dashboard</li>
      </ul>
    </div>
  );
}

export default Features;
